// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Extra/PoolBaseStruct.sol";
import "./Extra/PoolVirtual.sol";
import "./../../RandomChoice.sol";


contract StonePool is PoolBaseStruct, PoolStoneVirtual {

    // List of Stone and their info
    mapping(uint256 => Stone) public StoneList;

    /** 
        Matrix of all rarity minting info
        For every season (first param) there is a row ( called rarityRow, second param ) that contain info abouth quantity and cost of NFT
    */
    mapping(uint256 =>  mapping(uint256 => NFTPoolInfo)) public StoneMatrixForSeason;

    // Matrix for minting probability
    // mapping(uint256 => RarityRow) public StoneRarityMatrix;
    mapping(uint256 => mapping(uint256 => uint256[])) public StoneRarityMatrix;



    // SET BASE INFO
    uint256 baseIDNFTCounter;



    constructor (
        address _NFTManagerAddress,
        address _RandomChoiceAddress,

        string memory _baseUri
    ) 
        
        PoolBaseStruct (
            _NFTManagerAddress, _RandomChoiceAddress,
            _baseUri, "Stone", "STN"
        ) 

    {
        baseIDNFTCounter = 1;
    }



    

    function mintingPrivate (
        uint256 tokenRarity,
        uint256 seasonKey,

        address to,
        string memory name
    ) public override returns (bool) {
        require(msg.sender == getNFTManagerAddress(), "msg.sender is not correct");
        require(getStonePoolInfo(seasonKey, tokenRarity).quantity > 0,"There are no one NFT into pool for this rarity");

        uint256 bIDC = baseIDNFTCounter++;

        StoneList[bIDC].name = name;
        StoneList[bIDC].id = bIDC;
        StoneList[bIDC].level = 0;
        StoneList[bIDC].ar = tokenRarity;

        _safeMint(to, bIDC);
        _setTokenURI(bIDC, string.concat(name, Strings.toString(bIDC)));

        return true;
    }
    function getStoneInfo(uint256 StonetID) public override view returns (Stone memory) { return StoneList[StonetID]; }

    
    
    function setStonePoolInfo(uint256 seasonID, uint256 rt, uint256 _quantity, uint256 _cost ) public override { 
        require(msg.sender == owner() || msg.sender == address(this) || msg.sender == getNFTManagerAddress(), "You can not call this function");
        StoneMatrixForSeason[seasonID][rt].quantity = _quantity;
        StoneMatrixForSeason[seasonID][rt].cost = _cost;
    }
    
    function getStonePoolInfo (uint256 seasonID, uint256 rarityColon) public override view returns(NFTPoolInfo memory) 
        { return StoneMatrixForSeason[seasonID][rarityColon]; }
    


    function PoolIsEmpty (uint256 seasonID) public view override returns(bool poolIsEmpty) { 
        require(msg.sender == getNFTManagerAddress(), "msg.sender is not correct");
        poolIsEmpty = true;

        if ( StoneMatrixForSeason[seasonID][0].quantity > 0 &&
            StoneMatrixForSeason[seasonID][1].quantity > 0 && 
            StoneMatrixForSeason[seasonID][2].quantity > 0 && 
            StoneMatrixForSeason[seasonID][3].quantity > 0 && 
            StoneMatrixForSeason[seasonID][4].quantity > 0
        ) { poolIsEmpty = false; }

    }




    function setStoneRarity(uint256 r1, uint256 r2, uint256[] memory br) public override onlyOwner 
        { StoneRarityMatrix[r1][r2] = br; }
    function getStoneRarity(uint256 r1, uint256 r2) public view override returns (uint256[] memory rb) 
        { rb = StoneRarityMatrix[r1][r2]; }
    
    
    function getRarityForMinting(uint256 r1, uint256 r2) public override returns(uint256 rt) {
        uint256[] memory rb = getStoneRarity(r1, r2);
        
        for (uint i=0; ; i++) {
            if (i == rb.length) i = 0;

            if ( rb[i] != 0 && RandomChoice(getRandomChoiceAddress()).choice(rb[i], 100) ) 
                { rt = i; break; }
            
        }

    }


}
